customerRequirement.deliveryTerm:
С 01.01.2021по 31.12.2021.
Техническое обслуживание-не более 1-го дня;
жестяно-сварочные – не более 7-и дней;
слесарные – не более 5-и дней;
ремонт электрооборудования – не более 3-х дней;
диагностические- не более 1-го дня;
кузовной ремонт и покраску-не более 10-ти дней;
ремонт узлов и агрегаторов -не более 5-и дней.
